(1, 'kwfalo-ichtbx-zflpyj-gecjpd-edzlwx', '0', 'Post Notification', '2018-12-13 09:31:36', '2018-12-13 09:31:37', 1, 'Hello {{NAME}},<br /><br />We have published a new blog article on our website : Trạm dừng chân 1<br /><a href=\'http://sourceredi.dienkim/diem-dung-chan-duc-3-2.html\' target=\'_blank\'><img width=\"557\" height=\"369\" src=\"http://sourceredi.dienkim/wp-content/uploads/diemkinhdoanh6.png\" class=\"attachment-full size-full wp-post-image\" alt=\"\" /></a><br /><br />You can view it from this link : <a href=\'http://sourceredi.dienkim/diem-dung-chan-duc-3-2.html\' target=\'_blank\'>http://sourceredi.dienkim/diem-dung-chan-duc-3-2.html</a><br /><br />Thanks & Regards,<br />Admin<br /><br />You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.', 'Sent', 'Immediately', 'New Post Published - Trạm dừng chân 1'),
(2, 'oeijky-vuspcf-aolxzm-nhrwmu-rwomyv', '0', 'Newsletter', '2018-12-13 09:31:38', '2018-12-13 09:31:39', 1, '<strong style=\"color: #990000\">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters & automatically notify subscribers about new blog posts once it is published. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br>Admin', 'Sent', 'Immediately', 'Welcome To Email Subscribers');
