(5, 1, '2018-11-05 10:52:37', '2018-11-05 03:52:37', '<label> Tên của bạn (bắt buộc)\r\n    [text* your-name] </label>\r\n\r\n<label> Địa chỉ Email (bắt buộc)\r\n    [email* your-email] </label>\r\n\r\n<label> Tiêu đề:\r\n    [text your-subject] </label>\r\n\r\n<label> Thông điệp\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Gửi đi\"]\nWebsite \"[your-subject]\"\n[your-name] <wordpress@wp111.dev1>\nGửi đến từ: [your-name] <[your-email]>\nTiêu đề: [your-subject]\n\nNội dung thông điệp:\n[your-message]\n\n-- \nEmail này được gửi đến từ form liên hệ của website Website (http://wp111.dev1)\nadmin@gmail.com\nReply-To: [your-email]\n\n0\n0\n\nWebsite \"[your-subject]\"\nWebsite <wordpress@wp111.dev1>\nNội dung thông điệp:\n[your-message]\n\n-- \nEmail này được gửi đến từ form liên hệ của website Website (http://wp111.dev1)\n[your-email]\nReply-To: admin@gmail.com\n\n0\n0\nXin cảm ơn, form đã được gửi thành công.\nCó lỗi xảy ra trong quá trình gửi. Xin vui lòng thử lại hoặc liên hệ người quản trị website.\nCó một hoặc nhiều mục nhập có lỗi. Vui lòng kiểm tra và thử lại.\nCó lỗi xảy ra trong quá trình gửi. Xin vui lòng thử lại hoặc liên hệ người quản trị website.\nBạn phải chấp nhận điều khoản trước khi gửi form.\nMục này là bắt buộc.\nNhập quá số kí tự cho phép.\nNhập ít hơn số kí tự tối thiểu.', 'Form liên hệ 1', '', 'publish', 'closed', 'closed', '', 'form-lien-he-1', '', '', '2018-11-05 10:52:37', '2018-11-05 03:52:37', '', 0, 'http://wp111.dev1/?post_type=wpcf7_contact_form&p=5', 0, 'wpcf7_contact_form', '', 0),
